<script>

    require(["dojo/dom",
        "dojo/parser",
        "esri/map",
        "esri/geometry/Point",
        "esri/geometry/webMercatorUtils",
        "esri/graphic",
        "esri/symbols/SimpleFillSymbol",
        "esri/symbols/SimpleLineSymbol",
        "dojo/_base/Color",
        "esri/geometry/Polygon",
        "dojo/json",
        "esri/SpatialReference",
        "esri/config",
        "dijit/form/TextBox",
        "dijit/layout/BorderContainer",
        "dijit/layout/ContentPane"
    ], function(
        dom,
        parser, 
        Map, 
        Point, 
        webMercatorUtils, 
        Graphic, 
        SimpleFillSymbol, 
        SimpleLineSymbol, 
        Color, 
        Polygon, 
        JSON, 
        SpatialReference, 
        esriConfig
      ) {

            parser.parse();

            var map = new Map("map",{
                basemap: "osm",
                autoResize: true,
                sliderStyle: 'large',
                wrapAround180: true,
                //displayGraphicsOnPan:! dojo.isIE,
                zoom: 3
            });

            function zoomTo() {
                var mylong = 40.5604;
                var mylat = -74.1380;
                var CenPoint = new Point({ "x": mylat, "y": mylong, " spatialReference": { " wkid": 4326 } });
                var mercator = webMercatorUtils.geographicToWebMercator(CenPoint);
                map.centerAndZoom(mercator, 11);
            }
            
            function addGeom() {
                
                /* tested with JSON, same effect
                var sfs = new SimpleFillSymbol({
                  "type": "esriSFS",
                  "style": "esriSFSSolid",
                  "color": [115,76,0,255],
                    "outline": {
                        "type": "esriSLS",
                        "style": "esriSLSDot",
                        "color": [115,76,0,255],
                        "width": 1
                    }
                });*/
                
                var fillSymbol = new SimpleFillSymbol(SimpleFillSymbol.STYLE_SOLID,
                  new SimpleLineSymbol(SimpleLineSymbol.STYLE_DASHDOT,  //fail    
                  //fail      //new SimpleLineSymbol(SimpleLineSymbol.STYLE_DASH,
                  //fail      //new SimpleLineSymbol(SimpleLineSymbol.STYLE_DASHDOTDOT,
                  //fail      //new SimpleLineSymbol(SimpleLineSymbol.STYLE_DOT,
                  //fail      //new SimpleLineSymbol(SimpleLineSymbol.STYLE_LONGDASH,
                  //fail      //new SimpleLineSymbol(SimpleLineSymbol.STYLE_LONGDASHDOT,
                  //PASS      //new SimpleLineSymbol(SimpleLineSymbol.STYLE_STYLE_NULL,
                  //PASS      //new SimpleLineSymbol(SimpleLineSymbol.STYLE_STYLE_SOLID,
                  //fail      //new SimpleLineSymbol(SimpleLineSymbol.STYLE_SHORTDASH,
                  //fail      //new SimpleLineSymbol(SimpleLineSymbol.STYLE_SHORTDASHDOT,
                  //fail      //new SimpleLineSymbol(SimpleLineSymbol.STYLE_SHORTDASHDOTDOT,
                  //fail      //new SimpleLineSymbol(SimpleLineSymbol.STYLE_SHORTDOT,
                                new Color([255,0,0]), 2),
                        new Color([255,255,0,0.25])
                );
                
                var poly = new Polygon(JSON.parse(dom.byId('geometryInput').value, true));
                poly.setSpatialReference(new SpatialReference(parseInt(dom.byId('SpatialRef').value)));
                var gr = new Graphic(poly, fillSymbol)
                //var gr = new Graphic(poly, sfs);
                map.graphics.add(gr);
                map.setExtent(esri.graphicsExtent([gr]), true);
            }

            app = {
                addGeom: addGeom,
                zoomTo: zoomTo
            };

            return app;
            
            
        });
</script>
